import React from 'react';
import HeaderButton from './HeaderButton.jsx';
import NewButton from './NewButton.jsx';
// Header 컴포넌트 정의
function Header() {
  const headerStyle = {
      backgroundColor: '#D4D2E3',
      color: '#5D5A88',
      padding: '20px',
      position: 'relative',
      display: 'flex',
      justifyContent: 'left',
      alignItems: 'center',
      gridArea: 'header',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
    }
  return (
    <header style={headerStyle}>
      <div>
        <h3>⚖️BALANCETALK                           </h3>
      </div>
      <span style={{textAlign: 'right'}}><NewButton></NewButton>
        <HeaderButton name='Login'></HeaderButton>
        <HeaderButton name='Register'></HeaderButton></span>
    </header>
  );
}

export default Header;
